TileManager.prototype = {
	render: function(ctx) {
		for (var layer = 0; layer < this.jblob.layers.length; layer++) {
			if (layer == 2 || layer == 7) continue;
			this.spritemap = this.jblob.layers[layer].data;
			for (var i = 0; i < this.mapsize.height; i++) {
				for (var j = 0; j < this.mapsize.width; j++)	{
					var tile_num = this.spritemap[(this.mapsize.height * i + j)] - 1;
					var img = Resource.Image.forest;
					
					if (tile_num >= this.forest_tiles) {
						tile_num -= this.forest_tiles;
						img = Resource.Image.cabin;
					} else {
						ctx.drawImage(img,
							this.spritesize.width * tile_num + 0.5, 0,
							this.spritesize.width - 1, this.spritesize.height,
							this.spritesize.width * j * 4 - gx, this.spritesize.height * i * 4 - gy,
							this.spritesize.width * 4, this.spritesize.height * 4);
						continue;
					}
					if (tile_num >= this.cabin_tiles) {
						tile_num -= this.cabin_tiles;
						img = Resource.Image.sawmill;
					} else {
						ctx.drawImage(img,
							this.spritesize.width * tile_num + 0.5, 0,
							this.spritesize.width - 1, this.spritesize.height,
							this.spritesize.width * j * 4 - gx, this.spritesize.height * i * 4 - gy,
							this.spritesize.width * 4, this.spritesize.height * 4);
						continue;
					}
					if (tile_num >= this.sawmill_tiles) {
						tile_num -= this.sawmill_tiles;
						img = Resource.Image.cabin_corners;
					} else {
						ctx.drawImage(img,
							this.spritesize.width * tile_num + 0.5, 0,
							this.spritesize.width - 1, this.spritesize.height,
							this.spritesize.width * j * 4 - gx, this.spritesize.height * i * 4 - gy,
							this.spritesize.width * 4, this.spritesize.height * 4);
						continue;
					}
					if (tile_num >= this.cabin_corner_tiles) {
						tile_num -= this.cabin_corner_tiles;
						img = Resource.Image.beach;
					} else {
						ctx.drawImage(img,
							this.spritesize.width * tile_num + 0.5, 0,
							this.spritesize.width - 1, this.spritesize.height,
							this.spritesize.width * j * 4 - gx, this.spritesize.height * i * 4 - gy,
							this.spritesize.width * 4, this.spritesize.height * 4);
						continue;
					}
					if (tile_num >= this.beach_tiles) {
						tile_num -= this.beach_tiles;
						img = Resource.Image.barn;
					} else {
						ctx.drawImage(img,
							this.spritesize.width * tile_num + 0.5, 0,
							this.spritesize.width - 1, this.spritesize.height,
							this.spritesize.width * j * 4 - gx, this.spritesize.height * i * 4 - gy,
							this.spritesize.width * 4, this.spritesize.height * 4);
						continue;
					}
					if (tile_num >= this.barn_tiles) {
						tile_num -= this.barn_tiles;
						img = Resource.Image.graveyard;
					} else {
						ctx.drawImage(img,
								this.spritesize.width * tile_num + 0.5, 0,
								this.spritesize.width - 1, this.spritesize.height,
								this.spritesize.width * j * 4 - gx, this.spritesize.height * i * 4 - gy,
								this.spritesize.width * 4, this.spritesize.height * 4);
						continue;
					}
					
					if (tile_num < 2) {
						ctx.drawImage(img,
								this.spritesize.width * (tile_num+2) + 0.5, 0,
								this.spritesize.width - 1, this.spritesize.height,
								this.spritesize.width * j * 4 - gx, this.spritesize.height * i * 4 - gy,
								this.spritesize.width * 4, this.spritesize.height * 4);
					}
					ctx.drawImage(img,
								this.spritesize.width * tile_num + 0.5, 0,
								this.spritesize.width - 1, this.spritesize.height,
								this.spritesize.width * j * 4 - gx, this.spritesize.height * i * 4 - gy,
								this.spritesize.width * 4, this.spritesize.height * 4);
				}
			}
		}
	},
	
	initwalls: function(grid)
	{
		var walls = [];
		var count = 0;
		for(var i = 0; i < this.mapsize.height; i++)
		{
			for(var j = 0; j < this.mapsize.width; j++)
			{
				if (this.collisionmap[this.mapsize.height * i + j] == this.collisionnum)
				{
					walls.push(new Wall(this.spritesize.width * j * 4 - gx, this.spritesize.height * i * 4 - gy, grid));
					grid.add(walls[count]);
					count++;
				}
			}
		}
		return walls;
	},
}